        .main-menu {
            display: flex;
            align-items: center;
            height: 110px;
            background-color: #FDF1ED;
        }

        .main-menu .logo {
            position: absolute;
            left: 60px;
            height: 32px;
            width: 152px;
        }

        body {
            margin: 0;
            font-family: 'Overpass';
            color: #292727;
        }

        html,
        body {
            height: 100%;
        }

        main {
            padding: 20px;
        }

        section {
            margin-top: 120px;
            min-width: 300px;
            margin-left: auto;
            margin-right: auto;
        }

        .progress-representation {
            display: block;
            margin-left: auto;
            margin-right: auto;
            margin-bottom: 80px;
        }

        p {
            text-align: center;
            font-size: 24px;
        }

        @media only screen and (max-width: 1000px) {
            section {
                margin-top: 60px;
            }

            .progress-representation {
                margin-bottom: 40px;
